import React, { useState, useEffect } from 'react';

import axios from 'axios';

function App() {
    const [data, setData] = useState(null);

    useEffect(() => {
        axios.get('https://coronavirus-tracker-api.herokuapp.com/all')
            .then(result => {
                const infected = result.data;

                setData(infected);
            })
    })

    return (
    <div>
      <h1>CORONA</h1>
        <h2>{data}</h2>
    </div>
    );
}

export default App;
